export let prev = (src: string) => {
    let index = mapping[src];
    if (index === null || index === 0) {
        return null
    }
    let image = images[index - 1];
    return mapping[image.src] < index ? image : null;
}
export let next = (src: string) => {
    let index = mapping[src];
    if (index === null || index === images.length - 1) {
        return null
    }
    let image = images[index + 1];
    return mapping[image.src] > index ? image : null;
}
